import { Link } from 'react-router-dom';

import Logo from '../img/logo.jpeg'
import './Header.css'

function Header() {
    return (
        <header className='cabecalho'>
            <Link className='logo' to="/"><img src={Logo} /></Link>

            <nav className='links'>
                <span><Link to="Contato"></Link>Contato</span>
                <span><Link to="Sobre"></Link>Sobre</span>
                <span><Link to="Entrar"></Link>Entrar</span>

            </nav>

        </header>
    )
}
export default Header;
